var allLinks, link;

// discover embed tags - <embed>
allLinks = document.evaluate('//embed', document, null, XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE, null);

link = allLinks.snapshotItem(0).src;

$("body").append('<p id="wmx_link" style="text-align:center;">AQUI</p>');

$("#wmx_link").html(link);

//<Ref Href = "http://level.upx.net.br/00040_2" />
function getStreamLink(wmx) {
    var str = wmx;
    var re = new RegExp("Ref Href = \".*\"", "g");
    var myArray = str.match(re);    
    return myArray[0].split("\"")[1];
}

//http://wiki.greasespot.net/GM_xmlhttpRequest
GM_xmlhttpRequest({
  method: "GET",
  url: link,
  onload: function(response) {
    stream_link = getStreamLink(response.responseText);
    //alert(response.responseText);
    $("#wmx_link").html(link + "<br><br>" + stream_link);
  }
});
